// Simple function to calculate Levenshtein distance
function levenshtein(a, b) {
  const dp = Array.from({ length: a.length + 1 }, () => Array(b.length + 1).fill(0));
  for (let i = 0; i <= a.length; i++) dp[i][0] = i;
  for (let j = 0; j <= b.length; j++) dp[0][j] = j;
  for (let i = 1; i <= a.length; i++) {
    for (let j = 1; j <= b.length; j++) {
      if (a[i - 1].toLowerCase() === b[j - 1].toLowerCase()) {
        dp[i][j] = dp[i - 1][j - 1];
      } else {
        dp[i][j] = 1 + Math.min(dp[i - 1][j], dp[i][j - 1], dp[i - 1][j - 1]);
      }
    }
  }
  return dp[a.length][b.length];
}

export default function SearchScreen() {
  const [query, setQuery] = useState('');
  const [result, setResult] = useState(null);
  const [searched, setSearched] = useState(false);

  const handleSearch = () => {
    let bestMatch = null;
    let lowestDistance = Infinity;

    for (const recipe of mockRecipes) {
      const distance = levenshtein(query, recipe.name);
      if (distance < lowestDistance) {
        lowestDistance = distance;
        bestMatch = recipe;
      }
    }

    // Threshold for spelling mistakes tolerance
    if (lowestDistance <= 3) {
      setResult(bestMatch);
    } else {
      setResult(null);
    }

    setSearched(true);
  };

  return (
    <ImageBackground source={{ uri: backgroundImage }} style={styles.background} resizeMode="cover">
      <ScrollView contentContainerStyle={styles.container}>
        <Text style={styles.title}> Find Your Recipe </Text>
        <TextInput
          placeholder="Type a recipe name..."
          placeholderTextColor="#fff7"
          style={styles.input}
          value={query}
          onChangeText={setQuery}
        />
        <Button title="Search" color="#D35400" onPress={handleSearch} />
        
        {searched && result && (
          <View style={styles.resultContainer}>
            <Text style={styles.resultTitle}>{result.name}</Text>
            <Image source={{ uri: result.image }} style={styles.resultImage} resizeMode="contain" />
            <Text style={styles.resultText}>Calories: {result.calories} kcal</Text>
            <Text style={styles.subTitle}>Ingredients:</Text>
            {result.ingredients.map((ingredient, index) => (
              <Text key={index} style={styles.ingredient}>{`\u2022 ${ingredient}`}</Text>
            ))}
          </View>
        )}

        {searched && !result && (
          <Text style={styles.notFound}>No recipe found </Text>
        )}
      </ScrollView>
    </ImageBackground>
  );
}

